import React, { useState, useEffect } from "react";
import { axiosInstance, getAuthToken, decodeToken } from "../api/endpoint";

const MesDossiers = () => {
  const [dossiers, setDossiers] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchDossiers = async () => {
      try {
        console.log("Token décodé :", decodeToken(getAuthToken()));

        const response = await axiosInstance.get("/medecin/dossiers");
        console.log("Dossiers récupérés :", response.data);

        if (response.data.dossiers) {
          setDossiers(response.data.dossiers);
        } else {
          setDossiers(response.data);
        }

        setLoading(false);
      } catch (err) {
        console.error("Erreur récupération dossiers :", err);
        setError(err.response?.data?.message || "Erreur serveur");
        setLoading(false);
      }
    };

    fetchDossiers();
  }, []);

  // ✅ Activer / Désactiver
  const toggleStatut = async (id, statutActuel) => {
    try {
      const nouveauStatut = statutActuel === "ACTIF" ? "INACTIF" : "ACTIF";

      await axiosInstance.put(`/admin/${id}`, {
        statut: nouveauStatut
      });

      // mise à jour locale
      setDossiers((prev) =>
        prev.map((d) =>
          d._id === id ? { ...d, statut: nouveauStatut } : d
        )
      );
    } catch (err) {
      console.error("Erreur changement statut :", err);
      alert(err.response?.data?.message || "Erreur serveur");
    }
  };

  if (loading) return <p>Chargement des dossiers...</p>;
  if (error) return <p style={{ color: "red" }}>Erreur : {error}</p>;
  if (dossiers.length === 0) return <p>Aucun dossier trouvé.</p>;

  return (
    <div style={{ padding: "20px" }}>
      <h2>Mes Dossiers Patients</h2>

      <table
        border="1"
        cellPadding="8"
        cellSpacing="0"
        style={{ width: "100%", marginTop: "20px" }}
      >
        <thead>
          <tr>
            <th>Nom Patient</th>
            <th>Groupe Sanguin</th>
            <th>Résumé Médical</th>
            <th>Antécédents</th>
            <th>Allergies</th>
            <th>Contact d'Urgence</th>
            <th>Statut</th>
            <th>Action</th>
          </tr>
        </thead>

        <tbody>
          {dossiers.map((dossier) => (
            <tr key={dossier._id}>
              <td>{dossier.patient?.fullName || "N/A"}</td>
              <td>{dossier.groupeSanguin || "N/A"}</td>
              <td>{dossier.resumeMedical || "N/A"}</td>

              <td>
                {dossier.antecedents?.length
                  ? dossier.antecedents.map(a => a.libelle).join(", ")
                  : "Aucun"}
              </td>

              <td>
                {dossier.allergies?.length
                  ? dossier.allergies.map(a => a.libelle).join(", ")
                  : "Aucune"}
              </td>

              <td>
                {dossier.contactUrgence
                  ? `${dossier.contactUrgence.nom} (${dossier.contactUrgence.lien}) - ${dossier.contactUrgence.telephone}`
                  : "N/A"}
              </td>

              <td>
                <strong>{dossier.statut || "ACTIF"}</strong>
              </td>

              <td>
                <button
                  onClick={() => toggleStatut(dossier._id, dossier.statut || "ACTIF")}
                >
                  {dossier.statut === "ACTIF" ? "Désactiver" : "Activer"}
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default MesDossiers;
